  \"Advances in Uncertainty Representation and Management for Particle Filtering Applied
  to Prognostics\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:03:42.467109\",\n\t\"name\": \"advances-in-uncertainty-representation-and-management-for-particle-filtering-applied-to-pr\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Particle filters (PF) have been established
  as the de facto state of the artrnin failure prognosis. They combine advantages
  of the rigors of Bayesian estimationrnto nonlinear prediction while also providing
  uncertainty estimates with a given solution. Within the context of particle filters,
  this paper introduces several novel methods for uncertainty representations and
  uncertainty management. The prediction uncertainty is modeled via a rescaled Epanechnikov
  kernel and is assisted with resampling techniques and regularization algorithms.
  Uncertainty management is accomplished through parametric adjustments in a feedback
  correction loop of the state model and its noise distributions. The correction loop
  provides the mechanism to incorporate information that can improve solution accuracy
  and reduce uncertainty bounds. In addition, this approach results in reduction in
  computational burden. The scheme is illustrated with real vibration feature data
  from a fatigue-driven fault in a critical aircraft component.\",\n\t\"license_title\":
